import React from 'react';
import { useNavigate } from 'react-router-dom';
import './CurrentGame.css';

const CurrentGame = ({ currentMatch }) => {
  const navigate = useNavigate();

  return (
    <div className="current-game">
      {currentMatch ? (
        <>
          <h2>You are in a game!</h2>
          <p>Match ID: {currentMatch.matchId}</p>
          <button onClick={() => navigate(`/match/${currentMatch.matchId}`)}>Go to Match</button>
        </>
      ) : (
        <div className="popup-container">
          <div className="popup">
            <h3>You are not in a game.</h3>
            <button onClick={() => navigate('/tournaments')}>Go to Tournaments</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default CurrentGame;
